    return <div className="column">Select a document to view details</div>;
  }

  // Render the form fields or other details based on `documentData`
  return (
    <div className="column">
      <h2>{documentData.name}</h2>
      {/* Additional rendering logic for displaying documentData */}
    </div>
  );
};

export default FormContainer;
